import './App.css';
import Navbar from './components/Navbar';
import Card from './components/Card';
import placesData from './assets/placesData';

function App() {

  let stars = []
  for (let i = 0; i < placesData.length; i++) {
    let ratingCount = placesData[i].rating
    for (let i = 0; i < ratingCount; i++) {
      stars.push(<img className="pin" src="https://cdn.iconscout.com/icon/free/png-256/map-pin-1452950-1227762.png"/>)
    }
  }

  const visitedPlaces = placesData.map(visit => 
    <Card
      key={visit.id}
      {...visit}
      stars = {stars}
    />  
  )

  return (
    <div>
      <Navbar/>
      {visitedPlaces}
    </div>
  );
}

export default App;
